def get_workpermit_type(workpermit):
    match workpermit:
        case (
            "Exemption from Labour Market Impact Assessment"
            | "Open Work Permit"
            | "Open work permit for vulnerable workers"
            | "Post Graduation Work Permit"
        ):
            return "OO"
        case "Labour Market Impact Assessment Stream":
            return "LMIA"
        case "Live-in Caregiver Program" | "Start-up Business Class":
            return "OES"
        case "International Experience Canada (IEC)":
            return "IEC"


